 "ἁγνίζω": "<b>ἁγνίζω</b> : <u>Anglais</u> : wash off, cleanse away  -|-  <u>Français</u> : ﻿laver, nettoyer<br><td class=\"greek\">ἁγνίζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ἁγνισμός": "<b>ἁγνισμός</b> : <u>Anglais</u> : purification, expiation  -|-  <u>Français</u> : ﻿purification, expiation<br><td class=\"greek\">ἁγνισμός</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἀγνοέω": "<b>ἀγνοέω</b> : <u>Anglais</u> : not to perceive  -|-  <u>Français</u> : ﻿ne pas percevoir<br><td class=\"greek\">ἀγνοέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act epic doric ionic aeolic</td>",
 "ἀγνόημα": "<b>ἀγνόημα</b> : <u>Anglais</u> : fault of ignorance, oversight  -|-  <u>Français</u> : ﻿faute d'ignorance, de surveillance<br><td class=\"greek\">ἀγνόημα</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ἄγνοια": "<b>ἄγνοια</b> : <u>Anglais</u> : want of perception, ignorance  -|-  <u>Français</u> : ﻿manque de perception, ignorance<br><td class=\"greek\">ἄγνοια</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc</td>",
 "ἁγνός": "<b>ἁγνός</b> : <u>Anglais</u> : pure, chaste, holy  -|-  <u>Français</u> : ﻿pur, chaste, saint<br><td class=\"greek\">ἁγνός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
