 "ἁγνῶς": "<b>ἁγνός</b> : <u>Anglais</u> : pure, chaste, holy  -|-  <u>Français</u> : ﻿pur, chaste, saint<br><td class=\"greek\">ἁγνῶς</td>&ensp;<td><span style='color:red'>adverbe</span></td>",
 "ἀγνωσία": "<b>ἀγνωσία</b> : <u>Anglais</u> : ignorance  -|-  <u>Français</u> : ﻿ignorance<br><td class=\"greek\">ἀγνωσία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td>",
 "ἄγνωστος": "<b>ἄγνωστος</b> : <u>Anglais</u> : unknown  -|-  <u>Français</u> : ﻿inconnu<br><td class=\"greek\">ἄγνωστος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
