 "ἀγοράζω": "<b>ἀγοράζω</b> : <u>Anglais</u> : frequent the  -|-  <u>Français</u> : ﻿fréquente le<br><td class=\"greek\">ἀγοράζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
