 "ἀγράμματος": "<b>ἀγράμματος</b> : <u>Anglais</u> : illiterate  -|-  <u>Français</u> : ﻿analphabète<br><td class=\"greek\">ἀγράμματος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> nom</td>",
