 "ἀγρεύω": "<b>ἀγρεύω</b> : <u>Anglais</u> : take by hunting  -|-  <u>Français</u> : ﻿prendre en chassant<br><td class=\"greek\">ἀγρεύω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ἀγριέλαιος": "<b>ἀγριέλαιος</b> : <u>Anglais</u> : of a wild olive  -|-  <u>Français</u> : ﻿d'une olive sauvage<br><td class=\"greek\">ἀγριέλαιος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> nom</td>",
