 "ἀκατάκριτος": "<b>ἀκατάκριτος</b> : <u>Anglais</u> : uncondemned,  -|-  <u>Français</u> : ﻿non condamné,<br><td class=\"greek\">ἀκατάκριτος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἀκατάλυτος": "<b>ἀκατάλυτος</b> : <u>Anglais</u> : indissoluble, perpetual  -|-  <u>Français</u> : ﻿indissoluble, perpétuel<br><td class=\"greek\">ἀκατάλυτος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἀκατάπαυστος": "<b>ἀκατάπαυστος</b> : <u>Anglais</u> : not to be set at rest, incessant  -|-  <u>Français</u> : ﻿ne pas être au repos, incessant<br><td class=\"greek\">ἀκατάπαυστος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἀκαταστασία": "<b>ἀκαταστασία</b> : <u>Anglais</u> : instability, anarchy, confusion,  -|-  <u>Français</u> : ﻿instabilité, anarchie, confusion,<br><td class=\"greek\">ἀκαταστασία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td>",
