 "ἀκμάζω": "<b>ἀκμάζω</b> : <u>Anglais</u> : to be in full bloom, at the prime  -|-  <u>Français</u> : ﻿être en pleine floraison, au premier<br><td class=\"greek\">ἀκμάζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
 "ἀκμήν": "<b>ἀκμή</b> : <u>Anglais</u> : point, edge  -|-  <u>Français</u> : ﻿point, bord<br><td class=\"greek\">ἀκμήν</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> acc attic epic ionic</td>",
 "ἀκοή": "<b>ἀκοή</b> : <u>Anglais</u> : hearing, sound heard  -|-  <u>Français</u> : ﻿audition, son entendu<br><td class=\"greek\">ἀκοή</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic ionic</td>",
