 "ἀκούω": "<b>ἀκούω</b> : <u>Anglais</u> : hear  -|-  <u>Français</u> : ﻿entendre<br><td class=\"greek\">ἀκούω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ἀκρασία": "<b>ἀκρασία</b> : <u>Anglais</u> : bad mixture, ill temperature  -|-  <u>Français</u> : ﻿mauvais mélange, mauvaise température<br><td class=\"greek\">ἀκρασία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td><br><br><b>ἀκρασία2</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ἀκρασία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td>",
 "ἀκρατής": "<b>ἀκρατέω</b> : <u>Anglais</u> : to be  -|-  <u>Français</u> : ﻿être<br><td class=\"greek\">ἀκρατής</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg pres ind act doric aeolic contr</td><br><br><b>ἀκρατής</b> : <u>Anglais</u> : powerless, impotent  -|-  <u>Français</u> : ﻿impuissant, impuissant<br><td class=\"greek\">ἀκρατής</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἄκρατος": "<b>ἄκρατος</b> : <u>Anglais</u> : unmixed, neat  -|-  <u>Français</u> : ﻿sans mélange, soigné<br><td class=\"greek\">ἄκρατος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἀκρίβεια": "<b>ἀκρίβεια</b> : <u>Anglais</u> : exactness, precision  -|-  <u>Français</u> : ﻿exactitude, précision<br><td class=\"greek\">ἀκρίβεια</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc</td>",
 "ἀκριβέστατος": "<b>ἀκριβής</b> : <u>Anglais</u> : exact, accurate, precise  -|-  <u>Français</u> : ﻿exact, précis, précis<br><td class=\"greek\">ἀκριβέστατος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom superl</td>",
 "ἀκριβέστερον": "<b>ἀκριβής</b> : <u>Anglais</u> : exact, accurate, precise  -|-  <u>Français</u> : ﻿exact, précis, précis<br><td class=\"greek\">ἀκριβέστερον</td>&ensp;<td><span style='color:red'>adverbe</span> comp</td>",
