 "ἀκριβῶς": "<b>ἀκριβής</b> : <u>Anglais</u> : exact, accurate, precise  -|-  <u>Français</u> : ﻿exact, précis, précis<br><td class=\"greek\">ἀκριβῶς</td>&ensp;<td><span style='color:red'>adverbe</span> attic epic doric contr</td><br><br><b>ἀκριβόω</b> : <u>Anglais</u> : make exact  -|-  <u>Français</u> : ﻿rendre exact<br><td class=\"greek\">ἀκριβῶς</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg pres ind act doric aeolic contr</td><br><br><b>ἀκριβῶς</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ἀκριβῶς</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
