 "ἀκροατήριον": "<b>ἀκροατήριον</b> : <u>Anglais</u> : place of audience,  -|-  <u>Français</u> : ﻿lieu d'audience,<br><td class=\"greek\">ἀκροατήριον</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ἀκροατής": "<b>ἀκροατής</b> : <u>Anglais</u> : hearer  -|-  <u>Français</u> : ﻿auditeur<br><td class=\"greek\">ἀκροατής</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> nom</td>",
