 "ἀλαζών": "<b>ἀλαζών</b> : <u>Anglais</u> : wanderer about country, vagrant  -|-  <u>Français</u> : ﻿vagabond sur le pays, vagabond<br><td class=\"greek\">ἀλαζών</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> voc</td>",
