 "ἄλευρον": "<b>ἄλευρον</b> : <u>Anglais</u> : wheat-meal  -|-  <u>Français</u> : ﻿farine de blé<br><td class=\"greek\">ἄλευρον</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td><br><br><b>ἄλευρον2</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ἄλευρον</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ἀλήθεια": "<b>ἀλήθεια</b> : <u>Anglais</u> : truth  -|-  <u>Français</u> : ﻿vérité<br><td class=\"greek\">ἀλήθεια</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc</td>",
