 "ἀλήθω": "<b>ἀλάομαι</b> : <u>Anglais</u> : wander, roam  -|-  <u>Français</u> : ﻿errer, errer<br><td class=\"greek\">ἀλήθω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg aor subj mp attic epic doric ionic contr</td><br><br><b>ἀλήθω</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ἀλήθω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ἀληθῶς": "<b>ἀληθής</b> : <u>Anglais</u> : unconcealed  -|-  <u>Français</u> : ﻿non dissimulé<br><td class=\"greek\">ἀληθῶς</td>&ensp;<td><span style='color:red'>adverbe</span> attic epic doric contr</td>",
 "ἁλιεύς": "<b>ἁλιεύς</b> : <u>Anglais</u> : one who has to do with the sea  -|-  <u>Français</u> : ﻿celui qui a à voir avec la mer<br><td class=\"greek\">ἁλιεύς</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἁλιεύω": "<b>ἁλιεύω</b> : <u>Anglais</u> : fish,  -|-  <u>Français</u> : ﻿poisson,<br><td class=\"greek\">ἁλιεύω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ἁλίζω": "<b>ἁλίζω</b> : <u>Anglais</u> : gather together, assemble  -|-  <u>Français</u> : ﻿rassembler, assembler<br><td class=\"greek\">ἁλίζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td><br><br><b>ἁλίζω2</b> : <u>Anglais</u> : salt  -|-  <u>Français</u> : ﻿sel<br><td class=\"greek\">ἁλίζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
 "ἀλίσγημα": "<b>ἀλίσγημα</b> : <u>Anglais</u> : pollution,  -|-  <u>Français</u> : ﻿la pollution,<br><td class=\"greek\">ἀλίσγημα</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ἀλλά": "<b>ἄλλος</b> : <u>Anglais</u> : y  -|-  <u>Français</u> : ﻿y<br><td class=\"greek\">ἀλλά</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> voc doric aeolic</td><br><br><b>ἄλλος</b> : <u>Anglais</u> : other, another  -|-  <u>Français</u> : ﻿autre, autre<br><td class=\"greek\">ἀλλά</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> voc doric aeolic</td><br><br><b>ἀλλά</b> : <u>Anglais</u> : otheruise  -|-  <u>Français</u> : ﻿autre<br><td class=\"greek\">ἀλλά</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
 "ἀλλάσσω": "<b>ἀλλάσσω</b> : <u>Anglais</u> : make other than it is, change, alter  -|-  <u>Français</u> : ﻿faire autre chose, changer, altérer<br><td class=\"greek\">ἀλλάσσω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td><br><br><b>ἀναλάζομαι</b> : <u>Anglais</u> : take again,  -|-  <u>Français</u> : ﻿prendre encore,<br><td class=\"greek\">ἀλλάσσω</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg aor ind mp homeric poetic unaugmented apocope</td>",
