 "ἀλληγορέω": "<b>ἀλληγορέω</b> : <u>Anglais</u> : interpret allegorically  -|-  <u>Français</u> : ﻿interpréter allégoriquement<br><td class=\"greek\">ἀλληγορέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act epic doric ionic aeolic</td>",
 "ἀλλήλων": "<b>ἀλλήλων</b> : <u>Anglais</u> : of one another, to one another, one another  -|-  <u>Français</u> : ﻿les uns des autres, les uns aux autres, les uns aux autres<br><td class=\"greek\">ἀλλήλων</td>&ensp;<td><span style='color:red'>adjectif</span> pl neut gen</td>",
 "ἀλλογενής": "<b>ἀλλογενής</b> : <u>Anglais</u> : of another race  -|-  <u>Français</u> : ﻿d'une autre race<br><td class=\"greek\">ἀλλογενής</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> nom</td>",
 "ἅλλομαι": "<b>ἅλλομαι</b> : <u>Anglais</u> : sal-  -|-  <u>Français</u> : ﻿sal-<br><td class=\"greek\">ἅλλομαι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind mid</td>",
