 "ἀλοάω": "<b>ἀλοάω</b> : <u>Anglais</u> : tread, thresh,  -|-  <u>Français</u> : ﻿marcher, battre,<br><td class=\"greek\">ἀλοάω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act doric aeolic parad_form</td>",
 "ἄλογος": "<b>ἄλογος</b> : <u>Anglais</u> : without  -|-  <u>Français</u> : ﻿sans pour autant<br><td class=\"greek\">ἄλογος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἀλόη": "<b>ἀλόη</b> : <u>Anglais</u> : bitter aloes, Aloe vera,  -|-  <u>Français</u> : ﻿aloès amer, Aloe vera,<br><td class=\"greek\">ἀλόη</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic ionic</td><br><br><b>ἀλοάω</b> : <u>Anglais</u> : tread, thresh,  -|-  <u>Français</u> : ﻿marcher, battre,<br><td class=\"greek\">ἀλόη</td>&ensp;<td><span style='color:red'>verbe</span> 3rd sg imperf ind act doric aeolic contr</td>",
 "ἅλς": "<b>ἅλς</b> : <u>Anglais</u> : salt,  -|-  <u>Français</u> : ﻿sel,<br><td class=\"greek\">ἅλς</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> voc indeclform</td><br><br><b>ἅλς</b> : <u>Anglais</u> : sea  -|-  <u>Français</u> : ﻿mer<br><td class=\"greek\">ἅλς</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> voc indeclform</td>",
