 "ἄλυπος": "<b>ἄλυπος</b> : <u>Anglais</u> : without pain,  -|-  <u>Français</u> : ﻿sans douleur,<br><td class=\"greek\">ἄλυπος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἅλυσις": "<b>ἅλυσις</b> : <u>Anglais</u> : chain,  -|-  <u>Français</u> : ﻿chaîne,<br><td class=\"greek\">ἅλυσις</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
 "ἀλυσιτελής": "<b>ἀλυσιτελής</b> : <u>Anglais</u> : unprofitable,  -|-  <u>Français</u> : ﻿peu rentable,<br><td class=\"greek\">ἀλυσιτελής</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἅλων": "<b>ἅλς</b> : <u>Anglais</u> : salt,  -|-  <u>Français</u> : ﻿sel,<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>nom</span> pl <span style='color:red'>masculin</span> gen indeclform</td><br><br><b>ἅλς</b> : <u>Anglais</u> : sea  -|-  <u>Français</u> : ﻿mer<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>nom</span> pl <span style='color:red'>masculin</span> gen indeclform</td><br><br><b>ἅλων</b> : <u>Anglais</u> : plantation  -|-  <u>Français</u> : ﻿plantation<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc</td><br><br><b>ἅλως</b> : <u>Anglais</u> : threshing-floor,  -|-  <u>Français</u> : ﻿aire de battage,<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> acc attic epic ionic</td><br><br><b>ἁλή</b> : <u>Anglais</u> : salt-works  -|-  <u>Français</u> : ﻿salines<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>nom</span> pl <span style='color:red'>féminin</span> gen</td><br><br><b>ἁλής</b> : <u>Anglais</u> : thronged, crowded, in a mass  -|-  <u>Français</u> : ﻿bondé, bondé, en masse<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>adjectif</span> pl neut gen attic epic doric ionic contr</td><br><br><b>ἁλίσκομαι</b> : <u>Anglais</u> : to be taken, conquered, fall into an enemy's hand  -|-  <u>Français</u> : ﻿être pris, conquis, tomber dans la main d'un ennemi<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>verbe</span> 3rd pl aor ind act epic doric aeolic</td><br><br><b>ἧλος</b> : <u>Anglais</u> : nail-head, stud  -|-  <u>Français</u> : ﻿tête de clou, goujon<br><td class=\"greek\">ἅλων</td>&ensp;<td><span style='color:red'>nom</span> pl <span style='color:red'>masculin</span> gen doric</td>",
 "ἀλώπηξ": "<b>ἀλώπηξ</b> : <u>Anglais</u> : fox, Canis vulpes  -|-  <u>Français</u> : ﻿renard, Canis vulpes<br><td class=\"greek\">ἀλώπηξ</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
 "ἅλωσις": "<b>ἅλωσις</b> : <u>Anglais</u> : capture,  -|-  <u>Français</u> : ﻿Capturer,<br><td class=\"greek\">ἅλωσις</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
 "ἅμα": "<b>ἅμα</b> : <u>Anglais</u> : at once, at the same time,  -|-  <u>Français</u> : ﻿à la fois, en même temps,<br><td class=\"greek\">ἅμα</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td><br><br><b>ἅμα2</b> : <u>Anglais</u> : at the same time  -|-  <u>Français</u> : ﻿à la fois<br><td class=\"greek\">ἅμα</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td><br><br><b>ἁμός</b> : <u>Anglais</u> : our, ours  -|-  <u>Français</u> : ﻿nos nôtre<br><td class=\"greek\">ἅμα</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> nom doric aeolic</td>",
 "ἀμαθής": "<b>ἀμαθής</b> : <u>Anglais</u> : ignorant, stupid,  -|-  <u>Français</u> : ﻿ignorant, stupide,<br><td class=\"greek\">ἀμαθής</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
