 "ἀμάραντος": "<b>ἀμάραντος</b> : <u>Anglais</u> : unfading,  -|-  <u>Français</u> : ﻿impérissable,<br><td class=\"greek\">ἀμάραντος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἁμαρτάνω": "<b>ἁμαρτάνω</b> : <u>Anglais</u> : Acut. (Sp.)  -|-  <u>Français</u> : ﻿Une coupe. (Sp.)<br><td class=\"greek\">ἁμαρτάνω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
 "ἁμάρτημα": "<b>ἁμάρτημα</b> : <u>Anglais</u> : failure, fault,  -|-  <u>Français</u> : ﻿échec, faute,<br><td class=\"greek\">ἁμάρτημα</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ἁμαρτία": "<b>ἁμάρτημα</b> : <u>Anglais</u> : failure, fault,  -|-  <u>Français</u> : ﻿échec, faute,<br><td class=\"greek\">ἁμαρτία</td>&ensp;<td><span style='color:red'>nom</span> pl neut voc</td><br><br><b>ἁμάρτιον</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ἁμαρτία</td>&ensp;<td><span style='color:red'>nom</span> pl neut nom</td><br><br><b>ἁμαρτία</b> : <u>Anglais</u> : a failure, fault,  -|-  <u>Français</u> : ﻿un échec, une faute,<br><td class=\"greek\">ἁμαρτία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td>",
 "ἀμάρτυρος": "<b>ἀμάρτυρος</b> : <u>Anglais</u> : without witness, unattested,  -|-  <u>Français</u> : ﻿sans témoin, sans attestation,<br><td class=\"greek\">ἀμάρτυρος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ἁμαρτωλός": "<b>ἁμαρτωλός</b> : <u>Anglais</u> : erroneous,  -|-  <u>Français</u> : ﻿erroné,<br><td class=\"greek\">ἁμαρτωλός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>féminin</span> nom</td>",
 "ἄμαχος": "<b>ἄμαχος</b> : <u>Anglais</u> : without battle:  -|-  <u>Français</u> : ﻿sans bataille:<br><td class=\"greek\">ἄμαχος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
