 "ἀμετακίνητος": "<b>ἀμετακίνητος</b> : <u>Anglais</u> : not to be moved from place to place, immovable,  -|-  <u>Français</u> : ﻿ne pas être déplacé d'un endroit à un autre, immeuble,<br><td class=\"greek\">ἀμετακίνητος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
