 "ἀναβαθμός": "<b>ἀναβαθμός</b> : <u>Anglais</u> : flight of steps, stair,  -|-  <u>Français</u> : ﻿escalier, escalier,<br><td class=\"greek\">ἀναβαθμός</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> nom</td>",
