 "ἀναγινώσκω": "<b>ἀναγιγνώσκω</b> : <u>Anglais</u> : know well, know certainly,  -|-  <u>Français</u> : ﻿sais bien, sais certainement,<br><td class=\"greek\">ἀναγινώσκω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act ionic</td>",
