 "Ἀντιπατρίς": "<b>ἀντιπατρίς</b> : <u>Anglais</u> : silver vessel,  -|-  <u>Français</u> : ﻿récipient en argent,<br><td class=\"greek\">ἀντιπατρίς</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
