 "ἔκβασις": "<b>ἔκβασις</b> : <u>Anglais</u> : way out of,  -|-  <u>Français</u> : ﻿sortir de,<br><td class=\"greek\">ἔκβασις</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
