 "ἐκεῖνος": "<b>ἐκεῖνος</b> : <u>Anglais</u> : the person there, that person  -|-  <u>Français</u> : ﻿la personne là-bas, cette personne<br><td class=\"greek\">ἐκεῖνος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
