 "ἐκζητέω": "<b>ἐκζητέω</b> : <u>Anglais</u> : seek out,  -|-  <u>Français</u> : ﻿rechercher,<br><td class=\"greek\">ἐκζητέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act epic doric ionic aeolic</td>",
