 "ἐκκρεμάννυμι": "<b>ἐκκρεμάννυμι</b> : <u>Anglais</u> : hang from  -|-  <u>Français</u> : ﻿pendre<br><td class=\"greek\">ἐκκρεμάννυμι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
