 "ἐπέχω": "<b>ἐπώχατο</b> : <u>Anglais</u> : were kept shut  -|-  <u>Français</u> : ﻿ont été maintenus fermés<br><td class=\"greek\">ἐπέχω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
