 "ὁμοῦ": "<b>ὁμός</b> : <u>Anglais</u> : one and the same, common, joint,  -|-  <u>Français</u> : ﻿une seule et même chose, commune, commune,<br><td class=\"greek\">ὁμοῦ</td>&ensp;<td><span style='color:red'>adjectif</span> sg neut gen</td><br><br><b>ὁμόω</b> : <u>Anglais</u> : unite  -|-  <u>Français</u> : ﻿unir<br><td class=\"greek\">ὁμοῦ</td>&ensp;<td><span style='color:red'>verbe</span> 3rd sg imperf ind act homeric ionic contr unaugmented</td><br><br><b>ὁμοῦ</b> : <u>Anglais</u> : at the same place, together,  -|-  <u>Français</u> : ﻿au même endroit, ensemble,<br><td class=\"greek\">ὁμοῦ</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
