 "ὅμως": "<b>ὅμως</b> : <u>Anglais</u> : all the same, nevertheless, notwithstanding, still  -|-  <u>Français</u> : ﻿néanmoins, malgré tout, toujours<br><td class=\"greek\">ὅμως</td>&ensp;<td>conj indeclform</td><br><br><b>ὅμως</b> : <u>Anglais</u> : all the same, nevertheless,  -|-  <u>Français</u> : ﻿tout de même, néanmoins,<br><td class=\"greek\">ὅμως</td>&ensp;<td>conj indeclform</td><br><br><b>ὁμός</b> : <u>Anglais</u> : one and the same, common, joint,  -|-  <u>Français</u> : ﻿une seule et même chose, commune, commune,<br><td class=\"greek\">ὅμως</td>&ensp;<td><span style='color:red'>adjectif</span> pl <span style='color:red'>masculin</span> acc doric</td><br><br><b>ὁμόω</b> : <u>Anglais</u> : unite  -|-  <u>Français</u> : ﻿unir<br><td class=\"greek\">ὅμως</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg pres ind act doric contr</td><br><br><b>ὁμῶς</b> : <u>Anglais</u> : equally, likewise, alike,  -|-  <u>Français</u> : ﻿également, de la même manière,<br><td class=\"greek\">ὅμως</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td><br><br><b>ὁμῶς</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ὅμως</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
 "ὄναρ": "<b>ὄναρ</b> : <u>Anglais</u> : dream, vision in sleep,  -|-  <u>Français</u> : ﻿rêve, vision dans le sommeil,<br><td class=\"greek\">ὄναρ</td>&ensp;<td><span style='color:red'>nom</span> sg neut nom indeclform</td>",
 "ὀνάριον": "<b>ὀνάριον</b> : <u>Anglais</u> : Vit.Aesop. Oxy.  -|-  <u>Français</u> : ﻿Vit.Aesop. Oxy.<br><td class=\"greek\">ὀνάριον</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ὀνειδίζω": "<b>ὀνειδίζω</b> : <u>Anglais</u> : cast in  -|-  <u>Français</u> : ﻿coulé dans<br><td class=\"greek\">ὀνειδίζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
