 "ὄνειδος": "<b>ὄνειδος</b> : <u>Anglais</u> : reproach, rebuke, censure, blame,  -|-  <u>Français</u> : ﻿reproche, reproche, censure, blâme,<br><td class=\"greek\">ὄνειδος</td>&ensp;<td><span style='color:red'>nom</span> sg neut nom</td>",
