 "ὀνικός": "<b>ὀνικός</b> : <u>Anglais</u> : of  -|-  <u>Français</u> : ﻿de<br><td class=\"greek\">ὀνικός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
