 "ὄνομα": "<b>ὄνομα</b> : <u>Anglais</u> : name  -|-  <u>Français</u> : ﻿Nom<br><td class=\"greek\">ὄνομα</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td><br><br><b>ὀνομάζω</b> : <u>Anglais</u> : speak of by name, call  -|-  <u>Français</u> : ﻿parler par son nom, appeler<br><td class=\"greek\">ὄνομα</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg fut ind act doric aeolic contr</td>",
 "ὀνομάζω": "<b>ὀνομάζω</b> : <u>Anglais</u> : speak of by name, call  -|-  <u>Français</u> : ﻿parler par son nom, appeler<br><td class=\"greek\">ὀνομάζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ὄνος": "<b>ὄνος</b> : <u>Anglais</u> : ass,  -|-  <u>Français</u> : ﻿cul,<br><td class=\"greek\">ὄνος</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
 "ὄντως": "<b>ὄντως</b> : <u>Anglais</u> : (sum), really, actually, verily,  -|-  <u>Français</u> : ﻿(somme), vraiment, en fait, en vérité,<br><td class=\"greek\">ὄντως</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
 "ὄξος": "<b>ὄξος</b> : <u>Anglais</u> : poor wine, 'vin ordinaire',  -|-  <u>Français</u> : ﻿mauvais vin, «vin ordinaire»,<br><td class=\"greek\">ὄξος</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "ὀξύς": "<b>ὀξύς</b> : <u>Anglais</u> : sharp, keen,  -|-  <u>Français</u> : ﻿pointu, vif,<br><td class=\"greek\">ὀξύς</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
