 "ὀπίσω": "<b>ὀπίσω</b> : <u>Anglais</u> : backwards,  -|-  <u>Français</u> : ﻿en arrière,<br><td class=\"greek\">ὀπίσω</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td><br><br><b>ὀπίζω</b> : <u>Anglais</u> : extract juice from,  -|-  <u>Français</u> : ﻿extraire le jus de,<br><td class=\"greek\">ὀπίσω</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg aor ind mid homeric ionic unaugmented</td>",
