 "ὅπλον": "<b>ὅπλον</b> : <u>Anglais</u> : tool, implement,  -|-  <u>Français</u> : ﻿outil, implémenter,<br><td class=\"greek\">ὅπλον</td>&ensp;<td><span style='color:red'>nom</span> sg neut acc</td>",
 "ὁποῖος": "<b>ὁποῖος</b> : <u>Anglais</u> : of what sort  -|-  <u>Français</u> : ﻿de quelle sorte<br><td class=\"greek\">ὁποῖος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ὁπότε": "<b>ὁπότε</b> : <u>Anglais</u> : when,  -|-  <u>Français</u> : ﻿quand,<br><td class=\"greek\">ὁπότε</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
 "ὅπου": "<b>ὅπου</b> : <u>Anglais</u> : in some places,  -|-  <u>Français</u> : ﻿à certains endroits,<br><td class=\"greek\">ὅπου</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td>",
 "ὀπτάνομαι": "<b>ὀπτάζομαι</b> : <u>Anglais</u> : to be seen,  -|-  <u>Français</u> : ﻿être vu,<br><td class=\"greek\">ὀπτάνομαι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind pass</td>",
 "ὀπτασία": "<b>ὀπτασία</b> : <u>Anglais</u> : vision,  -|-  <u>Français</u> : ﻿vision,<br><td class=\"greek\">ὀπτασία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td><br><br><b>ὀπτασία2</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ὀπτασία</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td>",
 "ὀπτός": "<b>ὀπτός</b> : <u>Anglais</u> : roasted, broiled,  -|-  <u>Français</u> : ﻿rôti, grillé,<br><td class=\"greek\">ὀπτός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td><br><br><b>ὀπτός</b> : <u>Anglais</u> : visible,  -|-  <u>Français</u> : ﻿visible,<br><td class=\"greek\">ὀπτός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ὀπώρα": "<b>ὀπώρα</b> : <u>Anglais</u> : the part of the year between the rising of Sirius and of Arcturus  -|-  <u>Français</u> : ﻿la partie de l'année entre la montée de Sirius et d'Arcturus<br><td class=\"greek\">ὀπώρα</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic doric aeolic</td><br><br><b>ὀπωρεύς</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ὀπώρα</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> acc attic contr r_e_i_alpha</td>",
 "ὅπως": "<b>ὅπως</b> : <u>Anglais</u> : as, in such manner as,  -|-  <u>Français</u> : ﻿comme, de la manière<br><td class=\"greek\">ὅπως</td>&ensp;<td>conj indeclform</td><br><br><b>ὅπως</b> : <u>Anglais</u> : how,  -|-  <u>Français</u> : ﻿Comment,<br><td class=\"greek\">ὅπως</td>&ensp;<td>conj indeclform</td><br><br><b>ὅπωϲ</b> : <u>Anglais</u> : in any way whatever, ever so little,  -|-  <u>Français</u> : ﻿de toute façon, très peu,<br><td class=\"greek\">ὅπως</td>&ensp;<td>conj indeclform</td><br><br><b>ὅπω?</b> : <u>Anglais</u> : <em>[definition unavailable]</em>  -|-  <u>Français</u> : ﻿<em> [définition non disponible] </em><br><td class=\"greek\">ὅπως</td>&ensp;<td>conj indeclform</td><br><br><b>ὅπω?</b> : <u>Anglais</u> : how ever,  -|-  <u>Français</u> : ﻿cependant,<br><td class=\"greek\">ὅπως</td>&ensp;<td>conj indeclform</td>",
 "ὅραμα": "<b>ὅραμα</b> : <u>Anglais</u> : that which is seen, visible object, sight,  -|-  <u>Français</u> : ﻿ce qui est vu, objet visible, vue,<br><td class=\"greek\">ὅραμα</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
