 "ὁρατός": "<b>ὁρατός</b> : <u>Anglais</u> : to be seen, visible,  -|-  <u>Français</u> : ﻿être vu, visible,<br><td class=\"greek\">ὁρατός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ὁράω": "<b>ὁράω</b> : <u>Anglais</u> : Inscr. destombeaux des rois  -|-  <u>Français</u> : ﻿Inscr. destombeaux des rois<br><td class=\"greek\">ὁράω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act epic parad_form</td>",
 "ὀργή": "<b>ὀργάω</b> : <u>Anglais</u> : to be getting ready to bear, growing ripe  -|-  <u>Français</u> : ﻿être prêt à supporter, mûrir<br><td class=\"greek\">ὀργή</td>&ensp;<td><span style='color:red'>verbe</span> 3rd sg imperf ind act homeric ionic unaugmented</td><br><br><b>ὀργή</b> : <u>Anglais</u> : natural impulse  -|-  <u>Français</u> : ﻿impulsion naturelle<br><td class=\"greek\">ὀργή</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic ionic</td>",
 "ὀργίζω": "<b>ὀργίζω</b> : <u>Anglais</u> : make angry, provoke to anger, irritate,  -|-  <u>Français</u> : ﻿mettre en colère, provoquer la colère, irriter,<br><td class=\"greek\">ὀργίζω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ὀργίλος": "<b>ὀργίλος</b> : <u>Anglais</u> : inclined to anger, irascible,  -|-  <u>Français</u> : ﻿enclin à la colère, irascible,<br><td class=\"greek\">ὀργίλος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "ὀργυιά": "<b>ὄργυια</b> : <u>Anglais</u> : the length of the outstretched arms,  -|-  <u>Français</u> : ﻿la longueur des bras tendus,<br><td class=\"greek\">ὀργυιά</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc</td>",
 "ὀρέγω": "<b>ὀρέγω</b> : <u>Anglais</u> : reach, stretch, stretch out,  -|-  <u>Français</u> : ﻿atteindre, étirer, étirer,<br><td class=\"greek\">ὀρέγω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "ὀρεινός": "<b>ὀρεινός</b> : <u>Anglais</u> : mountainous, hilly,  -|-  <u>Français</u> : ﻿montagneux, vallonné,<br><td class=\"greek\">ὀρεινός</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
