 "ὀρθοποδέω": "<b>ὀρθοποδέω</b> : <u>Anglais</u> : walk straight  -|-  <u>Français</u> : ﻿marche droit<br><td class=\"greek\">ὀρθοποδέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act epic doric ionic aeolic</td>",
