 "ὄρθριος": "<b>ὄρθριος</b> : <u>Anglais</u> : at daybreak, in the morning, early,  -|-  <u>Français</u> : ﻿au lever du jour, le matin, tôt,<br><td class=\"greek\">ὄρθριος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
