 "παιδαγωγός": "<b>παιδαγωγός</b> : <u>Anglais</u> : slave who went with a boy from home to school and back again  -|-  <u>Français</u> : ﻿esclave qui est allé avec un garçon de la maison à l'école et vice-versa<br><td class=\"greek\">παιδαγωγός</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> nom</td>",
