 "παίω": "<b>παίω</b> : <u>Anglais</u> : strike, smite  -|-  <u>Français</u> : ﻿grève, frapper<br><td class=\"greek\">παίω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td><br><br><b>παίω2</b> : <u>Anglais</u> : to eat  -|-  <u>Français</u> : ﻿manger<br><td class=\"greek\">παίω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act attic</td><br><br><b>παίζω</b> : <u>Anglais</u> : play like a child, sport  -|-  <u>Français</u> : ﻿jouer comme un enfant, faire du sport<br><td class=\"greek\">παίω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg fut ind act attic epic doric contr</td>",
