 "πάλη": "<b>πάλα</b> : <u>Anglais</u> : nugget  -|-  <u>Français</u> : ﻿pépite<br><td class=\"greek\">πάλη</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic ionic</td><br><br><b>πάλη</b> : <u>Anglais</u> : wrestling  -|-  <u>Français</u> : ﻿lutte<br><td class=\"greek\">πάλη</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic doric ionic</td><br><br><b>πάλη2</b> : <u>Anglais</u> : the finest meal  -|-  <u>Français</u> : ﻿le meilleur repas<br><td class=\"greek\">πάλη</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic doric ionic</td><br><br><b>παλέω</b> : <u>Anglais</u> : to be disabled  -|-  <u>Français</u> : ﻿être handicapé<br><td class=\"greek\">πάλη</td>&ensp;<td><span style='color:red'>verbe</span> 3rd sg imperf ind act doric aeolic poetic contr unaugmented</td>",
