 "πέλαγος": "<b>πέλαγος</b> : <u>Anglais</u> : the sea  -|-  <u>Français</u> : ﻿la mer<br><td class=\"greek\">πέλαγος</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
