 "πέμπτος": "<b>πέμπτος</b> : <u>Anglais</u> : fifth : with four others  -|-  <u>Français</u> : ﻿cinquième: avec quatre autres<br><td class=\"greek\">πέμπτος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td><br><br><b>πεμπτός</b> : <u>Anglais</u> : sent  -|-  <u>Français</u> : ﻿envoyé<br><td class=\"greek\">πέμπτος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td><br><br><b>πεμπτός</b> : <u>Anglais</u> : sent  -|-  <u>Français</u> : ﻿envoyé<br><td class=\"greek\">πέμπτος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
