 "πένης": "<b>πένης</b> : <u>Anglais</u> : one who works for his living, day-labourer, poor  -|-  <u>Français</u> : ﻿celui qui travaille pour sa vie, journalier, pauvre<br><td class=\"greek\">πένης</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>masculin</span> nom</td><br><br><b>πενέω</b> : <u>Anglais</u> : to be poor  -|-  <u>Français</u> : ﻿être pauvre<br><td class=\"greek\">πένης</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg pres ind act doric contr</td>",
