 "πεντακισχίλιοι": "<b>πεντακισχίλιοι</b> : <u>Anglais</u> : five thousand  -|-  <u>Français</u> : ﻿cinq mille<br><td class=\"greek\">πεντακισχίλιοι</td>&ensp;<td><span style='color:red'>adjectif</span> pl <span style='color:red'>masculin</span> voc</td>",
