 "πέντε": "<b>πέντε</b> : <u>Anglais</u> : five  -|-  <u>Français</u> : ﻿cinq<br><td class=\"greek\">πέντε</td>&ensp;<td>numeral indeclform</td>",
 "πεντεκαιδέκατος": "<b>πεντεκαιδέκατος</b> : <u>Anglais</u> : fifteenth  -|-  <u>Français</u> : ﻿quinzième<br><td class=\"greek\">πεντεκαιδέκατος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "πεντήκοντα": "<b>πεντήκοντα</b> : <u>Anglais</u> : fifty  -|-  <u>Français</u> : ﻿cinquante<br><td class=\"greek\">πεντήκοντα</td>&ensp;<td>numeral indeclform</td><br><br><b>πεντηκοντάς</b> : <u>Anglais</u> : body of fifty  -|-  <u>Français</u> : ﻿corps de cinquante<br><td class=\"greek\">πεντήκοντα</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc</td>",
