 "πεποίθησις": "<b>πεποίθησις</b> : <u>Anglais</u> : trust, confidence, boldness  -|-  <u>Français</u> : ﻿confiance, confiance, audace<br><td class=\"greek\">πεποίθησις</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
 "περ": "<b>πέρ</b> : <u>Anglais</u> : all  -|-  <u>Français</u> : ﻿tout<br><td class=\"greek\">περ</td>&ensp;<td><span style='color:red'>particule</span>ic enclitic indeclform</td>",
 "πέραν": "<b>πέρα</b> : <u>Anglais</u> : beyond, further  -|-  <u>Français</u> : ﻿au-delà, plus loin<br><td class=\"greek\">πέραν</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> acc attic doric aeolic</td><br><br><b>πέρα2</b> : <u>Anglais</u> : to a foreign city  -|-  <u>Français</u> : ﻿dans une ville étrangère<br><td class=\"greek\">πέραν</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> acc attic doric aeolic</td><br><br><b>πέραν</b> : <u>Anglais</u> : on the other side, across  -|-  <u>Français</u> : ﻿de l'autre côté, à travers<br><td class=\"greek\">πέραν</td>&ensp;<td><span style='color:red'>adverbe</span> indeclform</td><br><br><b>περάω</b> : <u>Anglais</u> : drive right through  -|-  <u>Français</u> : ﻿traverser à droite<br><td class=\"greek\">πέραν</td>&ensp;<td><span style='color:red'>verbe</span> pres inf act epic doric contr</td><br><br><b>περάω2</b> : <u>Anglais</u> : to carry beyond seas for the purpose of selling, to export for sale  -|-  <u>Français</u> : ﻿transporter au-delà des mers en vue de la vente, exporter pour la vente<br><td class=\"greek\">πέραν</td>&ensp;<td><span style='color:red'>verbe</span> pres inf act attic doric contr</td>",
