 "Πέργαμος": "<b>Πέργαμος</b> : <u>Anglais</u> : Pergamus  -|-  <u>Français</u> : ﻿Pergame<br><td class=\"greek\">πέργαμος</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> nom</td>",
 "περί": "<b>περί</b> : <u>Anglais</u> : round about, all round  -|-  <u>Français</u> : ﻿tout autour, tout autour<br><td class=\"greek\">περί</td>&ensp;<td>prep indeclform</td>",
 "περιάγω": "<b>περιάγνυμι</b> : <u>Anglais</u> : bend and break all round  -|-  <u>Français</u> : ﻿plier et casser tout autour<br><td class=\"greek\">περιάγω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg aor subj pass attic epic doric contr raw_pre<span style='color:red'>verbe</span></td><br><br><b>περιάγω</b> : <u>Anglais</u> : lead  -|-  <u>Français</u> : ﻿conduire<br><td class=\"greek\">περιάγω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act raw_pre<span style='color:red'>verbe</span></td>",
 "περιαιρέω": "<b>περιαιρέω</b> : <u>Anglais</u> : take away something that surrounds, strip off, remove  -|-  <u>Français</u> : ﻿enlever quelque chose qui entoure, se déshabiller, enlever<br><td class=\"greek\">περιαιρέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act epic doric ionic aeolic</td>",
 "περιαστράπτω": "<b>περιαστράπτω</b> : <u>Anglais</u> : flash around  -|-  <u>Français</u> : ﻿flasher<br><td class=\"greek\">περιαστράπτω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act raw_pre<span style='color:red'>verbe</span></td>",
 "περιβάλλω": "<b>περιβάλλω</b> : <u>Anglais</u> : throw round, about  -|-  <u>Français</u> : ﻿lancer, environ<br><td class=\"greek\">περιβάλλω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
 "περιβόλαιον": "<b>περιβόλαιον</b> : <u>Anglais</u> : that which is thrown round, covering  -|-  <u>Français</u> : ﻿ce qui est jeté rond, couvrant<br><td class=\"greek\">περιβόλαιον</td>&ensp;<td><span style='color:red'>nom</span> sg neut voc</td>",
 "περιδέω": "<b>περίοιδα</b> : <u>Anglais</u> : know well  -|-  <u>Français</u> : ﻿Bien connaître<br><td class=\"greek\">περιδέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg perf subj act epic poetic elide_pre<span style='color:red'>verbe</span></td><br><br><b>περιδέω</b> : <u>Anglais</u> : bind, tie round  -|-  <u>Français</u> : ﻿lier, nouer rond<br><td class=\"greek\">περιδέω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act</td>",
 "περιεργάζομαι": "<b>περιεργάζομαι</b> : <u>Anglais</u> : take more pains than enough about  -|-  <u>Français</u> : ﻿prendre plus de peine qu'assez<br><td class=\"greek\">περιεργάζομαι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind mp</td>",
