 "περιέρχομαι": "<b>περιέρχομαι</b> : <u>Anglais</u> : go round, go about  -|-  <u>Français</u> : ﻿faire le tour, aller<br><td class=\"greek\">περιέρχομαι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind mp raw_pre<span style='color:red'>verbe</span></td>",
 "περιέχω": "<b>περιέχω</b> : <u>Anglais</u> : encompass, embrace, surround  -|-  <u>Français</u> : ﻿englober, embrasser, entourer<br><td class=\"greek\">περιέχω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres subj act raw_pre<span style='color:red'>verbe</span></td>",
 "περιζώννυμι": "<b>περιζώννυμαι</b> : <u>Anglais</u> : to gird round oneself, gird oneself with  -|-  <u>Français</u> : ﻿se ceindre autour de soi, se ceindre avec<br><td class=\"greek\">περιζώννυμι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
