 "περικάθαρμα": "<b>περικάθαρμα</b> : <u>Anglais</u> : expiation  -|-  <u>Français</u> : ﻿expiation<br><td class=\"greek\">περικάθαρμα</td>&ensp;<td><span style='color:red'>nom</span> sg neut acc</td>",
