 "περίκειμαι": "<b>περίκειμαι</b> : <u>Anglais</u> : lie round about  -|-  <u>Français</u> : ﻿s'allonger<br><td class=\"greek\">περίκειμαι</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind mp</td>",
