 "περικρατής": "<b>περικρατέω</b> : <u>Anglais</u> : have full command of : hold fast  -|-  <u>Français</u> : ﻿avoir la pleine maîtrise de: tenir bon<br><td class=\"greek\">περικρατής</td>&ensp;<td><span style='color:red'>verbe</span> 2nd sg imperf ind act doric aeolic poetic contr unaugmented</td><br><br><b>περικρατής</b> : <u>Anglais</u> : grasping, tenacious  -|-  <u>Français</u> : ﻿saisir, tenace<br><td class=\"greek\">περικρατής</td>&ensp;<td><span style='color:red'>adjectif</span> pl <span style='color:red'>féminin</span> acc attic epic doric contr</td>",
 "περικρύπτω": "<b>περικρύπτω</b> : <u>Anglais</u> : conceal entirely  -|-  <u>Français</u> : ﻿cacher entièrement<br><td class=\"greek\">περικρύπτω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
 "περικυκλόω": "<b>περικυκλόω</b> : <u>Anglais</u> : encircle, encompass  -|-  <u>Français</u> : ﻿encercler, englober<br><td class=\"greek\">περικυκλόω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act epic parad_form</td>",
 "περιλάμπω": "<b>περιλάμπω</b> : <u>Anglais</u> : shine around  -|-  <u>Français</u> : ﻿briller autour<br><td class=\"greek\">περιλάμπω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg pres ind act</td>",
