 "περίλυπος": "<b>περίλυπος</b> : <u>Anglais</u> : very sad, deeply grieved  -|-  <u>Français</u> : ﻿très triste, profondément affligé<br><td class=\"greek\">περίλυπος</td>&ensp;<td><span style='color:red'>adjectif</span> sg <span style='color:red'>masculin</span> nom</td>",
 "περιμένω": "<b>περιμένω</b> : <u>Anglais</u> : wait for, await  -|-  <u>Français</u> : ﻿attends, attends<br><td class=\"greek\">περιμένω</td>&ensp;<td><span style='color:red'>verbe</span> 1st sg fut ind act attic epic doric contr</td>",
 "πέριξ": "<b>πέριξ</b> : <u>Anglais</u> : round about, all round  -|-  <u>Français</u> : ﻿tout autour, tout autour<br><td class=\"greek\">πέριξ</td>&ensp;<td>prep indeclform</td>",
