 "περιοχή": "<b>περιοχή</b> : <u>Anglais</u> : a containing, enclosing  -|-  <u>Français</u> : ﻿un contenant, enfermant<br><td class=\"greek\">περιοχή</td>&ensp;<td><span style='color:red'>nom</span> sg <span style='color:red'>féminin</span> voc attic epic ionic</td>",
